import React from "react";
import "./banner.css";

function Banner() {
  return (
    <div className="banner">
      <div className="banner_content">
        <h1 className="banner_title">hehe</h1>
      </div>
      <div className="banner_fade"></div>
    </div>
  );
}

export default Banner;
